import React, { useState } from "react";

function Text() {
  const [text, setText] = useState('');
  return (
    <div>
      <input
        onChange={(event) => {
          setText(event.target.value)
        }}
      ></input>
      <h1>{text}</h1>
    </div>
  )
}

export default Text;
